// Grasshopper Script Instance
#region Usings
using System;
using System.Linq;
using System.Collections;
using System.Collections.Generic;
using System.Drawing;

using Rhino;
using Rhino.Geometry;

using Grasshopper;
using Grasshopper.Kernel;
using Grasshopper.Kernel.Data;
using Grasshopper.Kernel.Types;
#endregion

public class Script_Instance : GH_ScriptInstance
{
    #region Notes
    /* 
      Members:
        RhinoDoc RhinoDocument
        GH_Document GrasshopperDocument
        IGH_Component Component
        int Iteration

      Methods (Virtual & overridable):
        Print(string text)
        Print(string format, params object[] args)
        Reflect(object obj)
        Reflect(object obj, string method_name)
    */
    #endregion

    private void RunScript(bool Run, int Limit, string Filter, ref object A)
{
    if (!Run)
    {
        A = "Click Run to start. (Solver will pause during placement)";
        return;
    }

    // --- CRITICAL SAFETY SETTINGS ---
    // 1. Disable the Logic Engine so components don't try to calculate
    bool wasEnabled = GrasshopperDocument.Enabled;
    GrasshopperDocument.Enabled = false;



    // 3. Grid Settings
    float xStart = this.Component.Attributes.Pivot.X + 300;
    float yStart = this.Component.Attributes.Pivot.Y;
    float xStep = 150;
    float yStep = 80;
    int maxCols = 40;

    int count = 0;
    int col = 0;
    int row = 0;

    var server = Grasshopper.Instances.ComponentServer;

    // List to hold objects before adding (slightly faster)
    var objsToAdd = new List<IGH_DocumentObject>();

    try
    {
        foreach (var proxy in server.ObjectProxies)
        {
            if (Limit > 0 && count >= Limit) break;

            // --- FILTERING ---
            // Skip "Hidden" (usually internal or deprecated stuff that causes bugs)
            if (proxy.Exposure == GH_Exposure.hidden) continue;

            // Skip Obsolete objects
            if (proxy.Obsolete) continue;

            // Apply Text Filter
            if (!string.IsNullOrEmpty(Filter))
            {
                if (!proxy.Desc.Category.Contains(Filter) && !proxy.Desc.Name.Contains(Filter))
                    continue;
            }

            // --- INSTANTIATION ---
            var obj = proxy.CreateInstance();
            if (obj == null) continue;

            // --- PLACEMENT ---
            // We set attributes manually to avoid expensive UI recalculations
            obj.CreateAttributes();

            float x = xStart + (col * xStep);
            float y = yStart + (row * yStep);

            obj.Attributes.Pivot = new PointF(x, y);

            // Add to our batch list
            objsToAdd.Add(obj);

            count++;
            col++;
            if (col >= maxCols)
            {
                col = 0;
                row++;
            }
        }

        // --- BATCH ADD TO CANVAS ---
        // This is the most dangerous part. We wrap it to ensure we don't make 
        // an Undo record for every single item (which kills RAM).

        // Disable Undo recording for this operation
        GrasshopperDocument.UndoUtil.RecordEvent("Mass Place"); 

        foreach (var obj in objsToAdd)
        {
            // AddObject(object, update, init) 
            // We set update=false (don't redraw) and init=false (don't auto-solve)
            GrasshopperDocument.AddObject(obj, false);
        }
    }
    catch (Exception ex)
    {
        A = "Error: " + ex.Message;
    }
    finally
    {
        // --- RESTORE STATE ---
        // Re-enable the solver
        GrasshopperDocument.Enabled = wasEnabled;


        // Force a SINGLE redraw at the end
        Grasshopper.Instances.RedrawCanvas();
    }

    A = $"Placed {count} objects. Canvas might lag on zoom due to object count.";
}

    public override void BeforeRunScript()
    {
    }

    public override void AfterRunScript()
    {
    }
}

